import React, { useEffect, useState } from "react";
import axios from "axios";

function WorkerList() {
    const [workers, setWorkers] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:8080/api/worker/list")
            .then(res => {
                setWorkers(res.data);
                console.log("Veri geldi:", res.data);
            })
            .catch(err => {
                console.error("Veri alınırken hata:", err);
            });
    }, []);

    return (
        <div>
            <h2>Çalışan Listesi</h2>
            <ul>
                {workers.map(worker => (
                    <li key={worker.id}>
                        {worker.name} - {worker.age} - {worker.gender}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default WorkerList;
